      <style>
        svg#freepik_stories-newsletter:not(.animated) .animable {
          opacity: 0;
        }
        svg#freepik_stories-newsletter.animated
          #freepik--background-complete--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            slideDown;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Shadow--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Floor--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            lightSpeedLeft;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Plant--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            slideDown;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Character--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomOut;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Device--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            slideRight;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated
          #freepik--paper-plane--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
          animation-delay: 0s;
        }
        svg#freepik_stories-newsletter.animated #freepik--Window--inject-7 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            lightSpeedLeft;
          animation-delay: 0s;
        }
        @keyframes slideDown {
          0% {
            opacity: 0;
            transform: translateY(-30px);
          }
          100% {
            opacity: 1;
            transform: translateY(0);
          }
        }
        @keyframes slideUp {
          0% {
            opacity: 0;
            transform: translateY(30px);
          }
          100% {
            opacity: 1;
            transform: inherit;
          }
        }
        @keyframes lightSpeedLeft {
          from {
            transform: translate3d(-50%, 0, 0) skewX(20deg);
            opacity: 0;
          }
          60% {
            transform: skewX(-10deg);
            opacity: 1;
          }
          80% {
            transform: skewX(2deg);
          }
          to {
            opacity: 1;
            transform: translate3d(0, 0, 0);
          }
        }
        @keyframes zoomOut {
          0% {
            opacity: 0;
            transform: scale(1.5);
          }
          100% {
            opacity: 1;
            transform: scale(1);
          }
        }
        @keyframes slideRight {
          0% {
            opacity: 0;
            transform: translateX(30px);
          }
          100% {
            opacity: 1;
            transform: translateX(0);
          }
        }
        @keyframes zoomIn {
          0% {
            opacity: 0;
            transform: scale(0.5);
          }
          100% {
            opacity: 1;
            transform: scale(1);
          }
        }
      </style>

            <feFlood

            <feComposite

            <feMerge>

          <filter id="hover" height="200%">
            <feMorphology
              in="SourceAlpha"

            ></feMorphology>
            <feFlood

            <feComposite

            <feMerge>

            <feColorMatrix

            ></feColorMatrix>

        </defs>
      </svg>
